import { Works } from '../data';

import '../styles/main.css';

const HomePortfolio = () => {
  return (
    <section class="h-screen flex flex-col justify-center bg-white" data-section="bg-white">
    <heading class="h-8 w-screen text-center text-2xl lg:text-4xl lg:mb-8 mb-4 font-futura">PORTFOLIO</heading>
        <div class="work-display h-2/3 lg:h-1/2 w-auto grid grid-rows-2 grid-cols-2 gap-4 mx-4
        md:mx-20 lg:grid-rows-1 lg:grid-cols-4">

            <div onclick="location.href='work-kernagis.html'" 
                 class="cursor-pointer border-2 lg:border-4 border-black flex bg-[url('../images/galva10.jpg')] bg-cover bg-top hover:bg-kernagis2 hover:bg-center duration-300">
                <button class="border-t-2 lg:border-t-4 border-black h-8 lg:h-12 w-full font-bold self-end bg-white text-xs 
                lg:text-base">VYTAUTAS KERNAGIS</button>
            </div>
            <div onclick="location.href='work-kernagis.html'" 
                 class="cursor-pointer border-2 lg:border-4 border-black flex bg-[url('../images/chebureki54.jpg')] bg-cover bg-top">
                <button class="border-t-2 lg:border-t-4 border-black h-8 lg:h-12 w-full font-bold self-end bg-white text-xs 
                lg:text-base hover:bg-yellow duration-150">ČEBURĖKŲ LEGENDA</button>
            </div>
            <div onclick="location.href='work-kernagis.html'" 
                 class="cursor-pointer border-2 lg:border-4 border-black flex bg-[url('../images/silainiai.png')] bg-cover bg-top">
                <button class="border-t-2 lg:border-t-4  border-black h-8 lg:h-12 w-full font-bold self-end bg-white text-xs 
                lg:text-base">PAMASKOMU</button>
            </div>
            <div onclick="location.href='work-kernagis.html'" 
                 class="cursor-pointer border-2 lg:border-4 border-black flex bg-[url('../images/skulptura8.jpg')] bg-cover bg-top">
                <button class="border-t-2 lg:border-t-4 border-black h-8 lg:h-12 w-full font-bold self-end bg-white text-xs 
                lg:text-base">KAŽKOKIA STATULA</button>
            </div>
        </div>


        {Works.map((workItem) => {
            const {id, title} = Works
            return (
                <h1>{title}</h1>
            );
        })}


    </section>
  );
}
export default HomePortfolio
